// Main React  And Fragment Import
import React , {Fragment} from 'react'

function Home()
{

    
    return(<Fragment>
       

       <div class="container">
    
          <div class="row">

                <div class="col-lg-6 name">
                    <h1 class="h1 pt-5 mt-5 ">I am Satheesh Kumar Modala </h1>
                    <h5 class="bg-success p-2 mt-3 w-75 text-center">Full Stack Developer</h5>


               

                <div class="col-lg-6">
                    <img src="mypic.jpg" class="   img-thumbnail "/>
               </div>

          </div>



     </div>
    </div>
       
       </Fragment>)
    
    
}

//exporting
export default Home;
